<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Jeu de Math</title>
    <link rel="stylesheet" href="style.css" />
    <script type="module" src="main.js" defer></script>
    <script src="jquery-3.7.1.min.js"></script>
    <link rel="shortcut icon" href="img/iconMath.ico" type="image/x-icon">
  </head>
  <body>
    <div class="main">
      <div class="players">
        <input
          type="text"
          name="playerName"
          id="playerName"
          placeholder="Nom du joueur"
        />
        <div id="createPlayer">Nouveau Joueur</div>
        <div class="player"></div>
      </div>
      <div class="welcome">
        <h1></h1>
      </div>
      <div class="gameSettings">
        <label for="gameSelector" style="display: none;">Type de jeu</label>
        <select name="GameSelect" id="gameSelector" style="display: none;">
          <option value="add">Addition</option>
          <option value="sub">Substraction</option>
          <option value="mult">Multiplication</option>
          <option value="div">Division</option>
          <option value="random">Aléatoire</option>
        </select>
        <span class="options">Options</span>
        <br />
        <div class="limits">
          <fieldset>
            <legend>Choisir des limites:</legend>
            <div id="positive">
              <input type="checkbox" id="positif" name="positif" checked />
              <label for="positif">Chiffres positifs</label>
            </div>
            <div class="numMin">
              <label for="min">Minimum</label>
              <input type="text" id="min" name="min" value="0" />
            </div>
            <div class="numMax">
              <label for="max">Maximum</label>
              <input type="text" id="max" name="max" value="10" />
            </div>
            <div id="multiplication">
              <label for="tables">Tables de multiplication</label>
              <input
                type="text"
                name="tables"
                id="tables"
                title="Saisir les tables voulues, séparées par des virgules"
                value="1,2,3,4,5,6,7,8,9"
              />
            </div>
          </fieldset>
        </div>

        <label for="level">Difficulté</label>
        <select name="Level" id="level">
          <option value="1" default>Fastoche</option>
          <option value="2">Moyen</option>
          <option value="3">Dur</option>
          <option value="4">Champion</option></select
        ><br />
        <label for="nbQuestions">Nombre de questions</label>
        <input type="number" name="nbQuestions" id="nbQuestions" value="10" />
        <div id="startGame">Prêt?</div>
      </div>
      <div class="gameArea">
        <div class="question"></div>
        <div class="challenge"></div>
        <div class="answer">
          <input type="number" name="answer" id="answer" />
          <div id="checkAnswer" class="button">Valider</div>
        </div>
        <div id="timer">
          <div class="countdown"></div>
        </div>
      </div>
      <div class="gameComplete">
        <h1>Game Over!</h1>
        <ul>
          <li id="score">Score: </li>
          <li id="timeBonus">Bonus de temps: </li>
          <li id="errors">Erreurs: </li>
          <li id="errorPenalities">Erreurs: </li>
          <li id="finalScore">Score final: </li>
          <li id="eval">Bref... </li>
        </ul>
        <div class="NewGame button">Nouvelle partie</div>
        <div class="changePlayer button">Changer de joueur</div>
        </div>
